    document.querySelector("nav").style.height = "70px";
    toggleButton.classList.remove('open');
    toggleanimation = false;
    document.querySelector("header").style.display = "flex";
    document.getElementById("ggtext").style.display ="flex";
    document.getElementById("ballheader").style.display = "flex";
  } 
  else {
    Right.classList.add("active");
    Left.classList.add("active");
    Ball.classList.add("active");
    Programs.classList.add("active");
    document.querySelector("nav").style.height = "100%";
    toggleButton.classList.add('open');
    toggleanimation = true;
    document.querySelector("header").style.display = "none";
    document.getElementById("ggtext").style.display ="none";
